import logo from './logo.svg';
import { ThemeProvider, createTheme} from '@mui/material/styles';
import {Box,Tab, Tabs} from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import './App.css';


function App() {
    const theme = createTheme({
        palette: {
            primary: {
              main:  '#da8129',
              dark: '#ffffff',
              light: '#ffffff',
              contrastText: 'rgba(0,0,0,0.87)',
            },
            secondary: {
              main: '#da8129',
            },
            background: {
              paper: '#ffffff',
              default: '#fff6ec',
            },
        },
        components: {
             MuiTabs: {
                styleOverrides: {
                    indicator: {
                        backgroundColor: '#da8129', // Customize indicator color
                    },
                },
            },
            MuiTab: {
                styleOverrides: {
                    root: {
                        color: '#da8129', // Customize text color
                        '&.Mui-selected': {
                            color: '#da8129', // Customize selected tab text color
                        },
                    },
                },
            },
        }
    })
    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Box >
                <Tabs
                    value={0}
                >
                    <Tab  label="about me"/>
                    <Tab  label="projects"/>
                </Tabs>
             </Box>
        </ThemeProvider>
  );
}

export default App;
